35072935:
Peta perolehan medali negara-negara peserta Olimpiade Musim Panas 2012.
Legenda:
Emas: negara-negara yang setidaknya meraih satu medali emas;
Perak: negara-negara yang setidaknya meraih satu medali perak;
Coklat: negara-negara yang setidaknya meraih satu medali perunggu;
Biru: negara-negara yang tidak meraih medali apapun;
Merah: negara-negara yang tidak berpartisipasi dalam Olimpiade Musim Panas 2012.

